import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { 
  Container,
  Navbar,
  Nav,
  NavDropdown
} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import ViewConfig from './pages/configs';
import TemperatureLogForm from './pages/Templog';
import ViewLogs from './pages/Viewlogs';

function App() {
  return (
    <Router>
      <div className="d-flex flex-column min-vh-100">
        {/* Navbar ที่ปรับปรุงแล้ว */}
        <Navbar bg="primary" variant="dark" expand="lg" sticky="top" collapseOnSelect={false}>
          <Container>
            <Navbar.Brand as={Link} to="/" className="fw-bold fs-4">
              Drone Management System
            </Navbar.Brand>
            
            {/* ปุ่มสำหรับ mobile ที่ไม่ต้องกด */}
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="ms-auto" style={{ fontWeight: '500' }}>
                <Nav.Link as={Link} to="/" className="mx-2 px-3 py-2 text-center">
                  <i className="bi bi-gear-fill me-2"></i>
                  View Config
                </Nav.Link>
                
                <Nav.Link as={Link} to="/temperature-log" className="mx-2 px-3 py-2 text-center">
                  <i className="bi bi-thermometer-half me-2"></i>
                  Temperature Log
                </Nav.Link>
                
                <Nav.Link as={Link} to="/view-logs" className="mx-2 px-3 py-2 text-center">
                  <i className="bi bi-list-check me-2"></i>
                  View Logs
                </Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        {/* Main Content */}
        <main className="flex-grow-1 py-4">
          <Container>
            <Routes>
              <Route path="/" element={<ViewConfig />} />
              <Route path="/temperature-log" element={<TemperatureLogForm />} />
              <Route path="/view-logs" element={<ViewLogs />} />
            </Routes>
          </Container>
        </main>

        {/* Footer */}
        <footer className="bg-dark text-white py-3 mt-auto">
          <Container className="text-center">
            <p className="mb-0">© {new Date().getFullYear()} (65011012 Wuttipat Aiemsomboonsuk)</p>
          </Container>
        </footer>
      </div>
    </Router>
  );
}

export default App;
